                                                                                                                Siapkan diri Anda untuk membawa souvenir lebih banyak, karena kami memberikan paket liburan menakjubkan dengan harga terbaik.
                                                                                                            </strong></span></div></li>

                                                                                                            <li><div class="slide img1" style="text-shadow: 2px 2px black;background-image: url('../wp-content/themes/mugs/images/aman.jpg');" ><span class="text2"><span class="judul2" style="text-shadow: 2px 2px black;font-family: BernardoModaSemibold;">Aman</span><br><br><strong style="text-shadow: 2px 2px black;font-family: CaviarDreams;font-size: 18px;">
                                                                                                                                    Kami hanya menjalin kerjasama dengan para profesional, jadi yang perlu Anda pikirkan hanyalah bersenang-senang tanpa perlu khawatir dengan segala hal yang tidak di inginkan.</strong></span></div></li>
